import React from "react";
import { Link } from "react-router-dom";

export default function AskQuestion() {
  return (
    <React.Fragment>
      <div className="w-full bg-sgray h-20 flex items-center justify-between">
        <h1 className="text-white mx-2">Top Questions</h1>
        <Link
          to={"/askquestion"}
          className="p-2 mr-2 bg-blue-500 text-white rounded-sm h-10 cursor-pointer"
        >
          Ask Question
        </Link>
      </div>
    </React.Fragment>
  );
}
